import React from 'react';

import './Aside.scss';

const Aside = () => {
	return (
    <div className="wrapper-aside"> 
			<div className="header-aside">
				<span className="icon-work-chat">
					Work-chat
				</span>
				<span className="icon-fun-chat">
					fun-chat
				</span>
			</div>

		</div>
	);
};

export default Aside;
